cmewc3cs400g8mi01irbs2lb4	{"en": "Objective", "ne": "उदेश्य"}	{"en": "To establish CSIO Dadeldhura as a regional hub for ICT innovation and digital transformation.\\n\\nTo promote digital literacy, technical skills, and capacity-building among students, professionals, and government staff.\\n\\nTo collaborate with local governments and institutions for strengthening e-governance and smart service delivery.\\n\\nTo encourage research, innovation, and entrepreneurship in the Far-Western region.\\n\\nTo contribute towards building an inclusive, knowledge-driven, and technologically empowered society.", "ne": "१. CSIO डडेल्धुरालाई सुदूरपश्चिम प्रदेशको सूचना प्रविधि नवप्रवर्तन तथा डिजिटल रूपान्तरणको केन्द्रीय केन्द्रका रूपमा स्थापना गर्ने।\\n२. विद्यार्थी, पेशेवर तथा सरकारी कर्मचारीबीच डिजिटल साक्षरता, प्राविधिक सीप र क्षमता अभिवृद्धि प्रवर्द्धन गर्ने।\\n३. ई–शासन तथा स्मार्ट सेवा प्रवाहलाई सुदृढ बनाउन स्थानीय तह तथा संस्थाहरूसँग सहकार्य गर्ने।\\n४. अनुसन्धान, नवप्रवर्तन तथा उद्यमशीलतालाई प्रोत्साहन गर्ने।\\n५. समावेशी, ज्ञान–आधारित र प्रविधि–सशक्त समाज निर्माणमा योगदान गर्ने।"}	{"en": "To establish CSIO Dadeldhura as a regional hub for ICT innovation and digital transformation.\\n\\nTo promote digital literacy, technical skills, and capacity-building among students, professionals, and government staff.\\n\\nTo collaborate with local governments and institutions for strengthening e-governance and smart service delivery.\\n\\nTo encourage research, innovation, and entrepreneurship in the Far-Western region.\\n\\nTo contribute towards building an inclusive, knowledge-driven, and technologically empowered society.", "ne": "१. CSIO डडेल्धुरालाई सुदूरपश्चिम प्रदेशको सूचना प्रविधि नवप्रवर्तन तथा डिजिटल रूपान्तरणको केन्द्रीय केन्द्रका रूपमा स्थापना गर्ने।\\n२. विद्यार्थी, पेशेवर तथा सरकारी कर्मचारीबीच डिजिटल साक्षरता, प्राविधिक सीप र क्षमता अभिवृद्धि प्रवर्द्धन गर्ने।\\n३. ई–शासन तथा स्मार्ट सेवा प्रवाहलाई सुदृढ बनाउन स्थानीय तह तथा संस्थाहरूसँग सहकार्य गर्ने।\\n४. अनुसन्धान, न