COPY public.office_descriptions (id, "officeDescriptionType", content, "createdAt", "updatedAt") FROM stdin;
cmepc8zxo00d5i0mlvzp69hsk	INTRODUCTION	{"en": "CSIO Dadeldhura is envisioned as a hub for innovation, research, and digital transformation in the Far-Western region of Nepal. Located in the scenic hills of Dadeldhura, the institution aims to provide technical training, digital literacy, and capacity-building opportunities for students, professionals, and government stakeholders.\\n\\nIts programs emphasize ICT education, applied research, and collaboration with local municipalities to promote e-governance and smart service delivery. Through community outreach and skill-development workshops, CSIO Dadeldhura seeks to bridge the digital divide and foster a culture of innovation, entrepreneurship, and inclusive growth.", "ne": "CSIO डडेल्धुरालाई सुदूरपश्चिम प्रदेशको नवप्रवर्तन तथा डिजिटल रूपान्तरणको केन्द्रीय केन्द्रको रूपमा परिकल्पना गरिएको छ। डडेल्धुराको रमणीय पहाडी भूभागमा अवस्थित यस संस्थाले सूचना प्रविधि (ICT) शिक्षा, अनुसन्धान तथा स्थानीय तहसँग सहकार्य गर्दै ई-शासन र स्मार्ट सेवा प्रवाहलाई सुदृढ बनाउने उद्देश्य राखेको छ। यसले विद्यार्थी, पेशेवर तथा स्थानीय समुदायलाई सीप विकास, तालिम तथा डिजिटल साक्षरता कार्यक्रममार्फत सशक्त बनाउँदै समावेशी र प्रविधिमैत्री समाज निर्माणमा योगदान गर्ने लक्ष्य लिएको छ।"}	2025-08-24 06:59:52.429	2025-08-24 06:59:52.429
cmepc9v9100d8i0mlimo8aafc	OBJECTIVE	{"en": "To establish CSIO Dadeldhura as a regional hub for ICT innovation and digital transformation.\\n\\nTo promote digital literacy, technical skills, and capacity-building among students, professionals, and government staff.\\n\\nTo collaborate with local governments and institutions for strengthening e-governance and smart service delivery.\\n\\nTo encourage research, innovation, and entrepreneurship in the Far-Western region.\\n\\nTo contribute towards building an inclusive, knowledge-driven, and technologically empowered society.", "ne": "१. CSIO डडेल्धुरालाई सुदूरपश्चिम प्रदेशको सूचना प्रविधि नवप्रवर्तन तथा डिजिटल रूपान्तरणको केन्द्रीय केन्द्रका रूपमा स्थापना गर्ने।\\n२. विद्यार्थी, पेशेवर तथा सरकारी कर्मचारीबीच डिजिटल साक्षरता, प्राविधिक सीप र क्षमता अभिवृद्धि प्रवर्द्धन गर्ने।\\n३. ई–शासन तथा स्मार्ट सेवा प्रवाहलाई सुदृढ बनाउन स्थानीय तह तथा संस्थाहरूसँग सहकार्य गर्ने।\\n४. अनुसन्धान, नवप्रवर्तन तथा उद्यमशीलतालाई प्रोत्साहन गर्ने।\\n५. समावेशी, ज्ञान–आधारित र प्रविधि–सशक्त समाज निर्माणमा योगदान गर्ने।"}	2025-08-24 07:00:33.014	2025-08-24 07:00:33.014
cmepcbh7100dpi0ml1n44yfgv	DIGITAL_CHARTER	{"en": "The Digital Charter of CSIO Dadeldhura is a guiding framework that defines our commitment to innovation, inclusion, and sustainable development through technology. It serves as a roadmap for empowering individuals, communities, and institutions in the Far-Western region of Nepal.\\n\\nCore Principles\\n\\nInnovation First – Promote creativity, research, and digital innovation as the foundation of regional growth.\\n\\nInclusive Access – Ensure that digital services and opportunities are accessible to all, regardless of geography, gender, or socio-economic background.\\n\\nTransparency & Accountability – Strengthen governance and service delivery through open, transparent, and accountable digital systems.\\n\\nCapacity Building – Provide continuous training, skill development, and knowledge-sharing for students, professionals, and government staff.\\n\\nCollaboration & Partnership – Foster cooperation with local governments, educational institutions, and private sector actors to build a sustainable digital ecosystem.\\n\\nData-Driven Society – Encourage evidence-based decision-making, digital record-keeping, and smart data use for better planning and development.\\n\\nSecurity & Ethics – Uphold the highest standards of cybersecurity, privacy, and digital ethics.\\n\\nOur Commitment\\n\\nCSIO Dadeldhura commits itself to leading the digital transformation journey of the Far-Western region by promoting innovation, inclusivity, and resilience in every aspect of ICT development.", "ne": "मुख्य सिद्धान्तहरू\\n\\n१. नवप्रवर्तन अग्रस्थानमा – क्षेत्रीय विकासको आधारका रूपमा सिर्जनशीलता, अनुसन्धान र डिजिटल नवप्रवर्तनलाई प्रवर्द्धन गर्ने।\\n२. समावेशी पहुँच – भूगोल, लिङ्ग वा आर्थिक अवस्थाबाट विभेद नगरी सबैलाई डिजिटल सेवा र अवसर सुनिश्चित गर्ने।\\n३. पारदर्शिता र जवाफदेहिता – खुला, पारदर्शी र जवाफदेही डिजिटल प्रणालीमार्फत शासन र सेवा प्रवाहलाई सुदृढ गर्ने।\\n४. क्षमता अभिवृद्धि – विद्यार्थी, पेशेवर तथा सरकारी कर्मचारीका लागि निरन्तर तालिम, सीप विकास र ज्ञान आदान–प्रदान गर्ने।\\n५. सहकार्य र साझेदारी – स्थानीय तह, शैक्षिक संस्था तथा निजी क्षेत्रसँग मिलेर दिगो डिजिटल पारिस्थितिकी तन्त्र निर्माण गर्ने।\\n६. डेटा–आधारित समाज – तथ्यमा आधारित निर्णय, डिजिटल अभिलेख व्यवस्थापन र स्मार्ट डेटा प्रयोगलाई प्रोत्साहित गर्ने।\\n७. सुरक्षा र नैतिकता – साइबर सुरक्षा, गोपनीयता तथा डिजिटल नैतिकताका उच्चतम मापदण्डलाई कायम गर्ने।\\n\\nहाम्रो प्रतिबद्धता\\n\\nCSIO डडेल्धुरा सुदूरपश्चिम प्रदेशको डिजिटल रूपान्तरण यात्रामा अग्रणी भई ICT विकासका प्रत्येक पक्षमा नवप्रवर्तन, समावेशिता र दिगोपनालाई प्रवर्द्धन गर्ने प्रतिबद्धता गर्दछ।"}	2025-08-24 07:01:48.11	2025-08-24 07:01:48.11
cmepccme300e6i0mld2kv67hl	ORGANIZATIONAL_STRUCTURE	{"en": "1. Governing Body\\n\\nAdvisory Board – Composed of senior experts, policymakers, and stakeholders who provide strategic direction and policy guidance.\\n\\nExecutive Board – Chaired by the Director, responsible for decision-making and overall governance.\\n\\n2. Executive Leadership\\n\\nDirector – Head of CSIO Dadeldhura, responsible for strategic leadership, vision, and external relations.\\n\\nDeputy Director – Supports the Director and oversees internal operations, planning, and implementation.\\n\\n3. Core Departments\\n\\nICT & Innovation Division\\n\\nDigital Research Unit\\n\\nSoftware Development & System Design Unit\\n\\nEmerging Technologies Unit (AI, IoT, Cloud)\\n\\nTraining & Capacity Building Division\\n\\nDigital Literacy & Awareness Unit\\n\\nProfessional Skills Training Unit\\n\\nGovernment Staff Training & Certification Unit\\n\\nE-Governance & Public Services Division\\n\\nMunicipal & Local Government Support Unit\\n\\nService Digitization Unit\\n\\nCitizen Engagement & Feedback Unit\\n\\nResearch & Policy Division\\n\\nDigital Policy & Governance Research Unit\\n\\nData Analysis & Knowledge Center\\n\\nPublication & Documentation Unit\\n\\nAdministration & Finance Division\\n\\nHuman Resource & Administration Unit\\n\\nFinance & Procurement Unit\\n\\nMonitoring & Evaluation Unit\\n\\n4. Support Units\\n\\nIT Support & Infrastructure Unit\\n\\nMedia & Communications Unit\\n\\nPartnership & Collaboration Cell", "ne": "१. शासी निकाय\\n\\nसल्लाहकार समिति – नीतिगत मार्गनिर्देशन दिने वरिष्ठ विज्ञ, नीति निर्माता तथा सरोकारवालाहरूले बनेको समिति।\\n\\nकार्यकारी समिति – निर्देशकको अध्यक्षतामा सञ्चालन हुने, निर्णय गर्ने र समग्र शासनको जिम्मेवारी लिने।\\n\\n२. कार्यकारी नेतृत्व\\n\\nनिर्देशक – CSIO डडेल्धुराको प्रमुख, रणनीतिक नेतृत्व, दृष्टि र बाह्य सम्बन्धको जिम्मेवारी।\\n\\nउप–निर्देशक – निर्देशकलाई सहयोग गर्ने, आन्तरिक योजना र कार्यान्वयनको जिम्मेवारी सम्हाल्ने।\\n\\n३. प्रमुख विभागहरू\\n\\n१. सूचना प्रविधि तथा नवप्रवर्तन प्रभाग\\n\\nडिजिटल अनुसन्धान इकाई\\n\\nसफ्टवेयर विकास तथा प्रणाली डिजाइन इकाई\\n\\nनवप्रवर्तन प्रविधि इकाई (AI, IoT, Cloud)\\n\\n२. तालिम तथा क्षमता अभिवृद्धि प्रभाग\\n\\nडिजिटल साक्षरता तथा जनचेतना इकाई\\n\\nव्यावसायिक सीप तालिम इकाई\\n\\nसरकारी कर्मचारी तालिम तथा प्रमाणीकरण इकाई\\n\\n३. ई–शासन तथा सार्वजनिक सेवा प्रभाग\\n\\nस्थानीय तह समर्थन इकाई\\n\\nसेवा डिजिटाइजेशन इकाई\\n\\nनागरिक सहभागिता तथा प्रतिक्रिया इकाई\\n\\n४. अनुसन्धान तथा नीतिगत प्रभाग\\n\\nडिजिटल नीति तथा शासन अनुसन्धान इकाई\\n\\nतथ्याङ्क विश्लेषण तथा ज्ञान केन्द्र\\n\\nप्रकाशन तथा दस्तावेजीकरण इकाई\\n\\n५. प्रशासन तथा वित्त प्रभाग\\n\\nमानव संसाधन तथा प्रशासन इकाई\\n\\nवित्त तथा खरिद इकाई\\n\\nअनुगमन तथा मूल्यांकन इकाई\\n\\n४. सहयोगी इकाईहरू\\n\\nआईटी समर्थन तथा पूर्वाधार इकाई\\n\\nमिडिया तथा सञ्चार इकाई\\n\\nसहकार्य तथा साझेदारी सेल"}	2025-08-24 07:02:41.5	2025-08-24 07:02:41.5
